webpackJsonp([0xac20cac4666],{3176:function(e,n){e.exports={pathContext:{docHtml:'<h1>Change Log</h1>\n<h2>0.5.6</h2>\n<ul>\n<li>\n<p>Fix for regression when people were using numbers as names in source maps. See</p>\n<h1>236.</h1>\n</li>\n</ul>\n<h2>0.5.5</h2>\n<ul>\n<li>\n<p>Fix "regression" of unsupported, implementation behavior that half the world\nhappens to have come to depend on. See #235.</p>\n</li>\n<li>\n<p>Fix regression involving function hoisting in SpiderMonkey. See #233.</p>\n</li>\n</ul>\n<h2>0.5.4</h2>\n<ul>\n<li>Large performance improvements to source-map serialization. See #228 and #229.</li>\n</ul>\n<h2>0.5.3</h2>\n<ul>\n<li>Do not include unnecessary distribution files. See\ncommit ef7006f8d1647e0a83fdc60f04f5a7ca54886f86.</li>\n</ul>\n<h2>0.5.2</h2>\n<ul>\n<li>Include browser distributions of the library in package.json\'s <code>files</code>. See\nissue #212.</li>\n</ul>\n<h2>0.5.1</h2>\n<ul>\n<li>Fix latent bugs in IndexedSourceMapConsumer.prototype._parseMappings. See\nff05274becc9e6e1295ed60f3ea090d31d843379.</li>\n</ul>\n<h2>0.5.0</h2>\n<ul>\n<li>\n<p>Node 0.8 is no longer supported.</p>\n</li>\n<li>\n<p>Use webpack instead of dryice for bundling.</p>\n</li>\n<li>\n<p>Big speedups serializing source maps. See pull request #203.</p>\n</li>\n<li>\n<p>Fix a bug with <code>SourceMapConsumer.prototype.sourceContentFor</code> and sources that\nexplicitly start with the source root. See issue #199.</p>\n</li>\n</ul>\n<h2>0.4.4</h2>\n<ul>\n<li>\n<p>Fix an issue where using a <code>SourceMapGenerator</code> after having created a\n<code>SourceMapConsumer</code> from it via <code>SourceMapConsumer.fromSourceMap</code> failed. See\nissue #191.</p>\n</li>\n<li>\n<p>Fix an issue with where <code>SourceMapGenerator</code> would mistakenly consider\ndifferent mappings as duplicates of each other and avoid generating them. See\nissue #192.</p>\n</li>\n</ul>\n<h2>0.4.3</h2>\n<ul>\n<li>\n<p>A very large number of performance improvements, particularly when parsing\nsource maps. Collectively about 75% of time shaved off of the source map\nparsing benchmark!</p>\n</li>\n<li>\n<p>Fix a bug in <code>SourceMapConsumer.prototype.allGeneratedPositionsFor</code> and fuzzy\nsearching in the presence of a column option. See issue #177.</p>\n</li>\n<li>\n<p>Fix a bug with joining a source and its source root when the source is above\nthe root. See issue #182.</p>\n</li>\n<li>\n<p>Add the <code>SourceMapConsumer.prototype.hasContentsOfAllSources</code> method to\ndetermine when all sources\' contents are inlined into the source map. See\nissue #190.</p>\n</li>\n</ul>\n<h2>0.4.2</h2>\n<ul>\n<li>\n<p>Add an <code>.npmignore</code> file so that the benchmarks aren\'t pulled down by\ndependent projects. Issue #169.</p>\n</li>\n<li>\n<p>Add an optional <code>column</code> argument to\n<code>SourceMapConsumer.prototype.allGeneratedPositionsFor</code> and better handle lines\nwith no mappings. Issues #172 and #173.</p>\n</li>\n</ul>\n<h2>0.4.1</h2>\n<ul>\n<li>Fix accidentally defining a global variable. #170.</li>\n</ul>\n<h2>0.4.0</h2>\n<ul>\n<li>\n<p>The default direction for fuzzy searching was changed back to its original\ndirection. See #164.</p>\n</li>\n<li>\n<p>There is now a <code>bias</code> option you can supply to <code>SourceMapConsumer</code> to control\nthe fuzzy searching direction. See #167.</p>\n</li>\n<li>\n<p>About an 8% speed up in parsing source maps. See #159.</p>\n</li>\n<li>\n<p>Added a benchmark for parsing and generating source maps.</p>\n</li>\n</ul>\n<h2>0.3.0</h2>\n<ul>\n<li>\n<p>Change the default direction that searching for positions fuzzes when there is\nnot an exact match. See #154.</p>\n</li>\n<li>\n<p>Support for environments using json2.js for JSON serialization. See #156.</p>\n</li>\n</ul>\n<h2>0.2.0</h2>\n<ul>\n<li>Support for consuming "indexed" source maps which do not have any remote\nsections. See pull request #127. This introduces a minor backwards\nincompatibility if you are monkey patching <code>SourceMapConsumer.prototype</code>\nmethods.</li>\n</ul>\n<h2>0.1.43</h2>\n<ul>\n<li>\n<p>Performance improvements for <code>SourceMapGenerator</code> and <code>SourceNode</code>. See issue</p>\n<h1>148 for some discussion and issues #150, #151, and #152 for implementations.</h1>\n</li>\n</ul>\n<h2>0.1.42</h2>\n<ul>\n<li>Fix an issue where <code>SourceNode</code>s from different versions of the source-map\nlibrary couldn\'t be used in conjunction with each other. See issue #142.</li>\n</ul>\n<h2>0.1.41</h2>\n<ul>\n<li>\n<p>Fix a bug with getting the source content of relative sources with a "./"\nprefix. See issue #145 and <a href="bugzil.la/1090768">Bug 1090768</a>.</p>\n</li>\n<li>\n<p>Add the <code>SourceMapConsumer.prototype.computeColumnSpans</code> method to compute the\ncolumn span of each mapping.</p>\n</li>\n<li>\n<p>Add the <code>SourceMapConsumer.prototype.allGeneratedPositionsFor</code> method to find\nall generated positions associated with a given original source and line.</p>\n</li>\n</ul>\n<h2>0.1.40</h2>\n<ul>\n<li>Performance improvements for parsing source maps in SourceMapConsumer.</li>\n</ul>\n<h2>0.1.39</h2>\n<ul>\n<li>Fix a bug where setting a source\'s contents to null before any source content\nhad been set before threw a TypeError. See issue #131.</li>\n</ul>\n<h2>0.1.38</h2>\n<ul>\n<li>Fix a bug where finding relative paths from an empty path were creating\nabsolute paths. See issue #129.</li>\n</ul>\n<h2>0.1.37</h2>\n<ul>\n<li>Fix a bug where if the source root was an empty string, relative source paths\nwould turn into absolute source paths. Issue #124.</li>\n</ul>\n<h2>0.1.36</h2>\n<ul>\n<li>Allow the <code>names</code> mapping property to be an empty string. Issue #121.</li>\n</ul>\n<h2>0.1.35</h2>\n<ul>\n<li>\n<p>A third optional parameter was added to <code>SourceNode.fromStringWithSourceMap</code>\nto specify a path that relative sources in the second parameter should be\nrelative to. Issue #105.</p>\n</li>\n<li>\n<p>If no file property is given to a <code>SourceMapGenerator</code>, then the resulting\nsource map will no longer have a <code>null</code> file property. The property will\nsimply not exist. Issue #104.</p>\n</li>\n<li>\n<p>Fixed a bug where consecutive newlines were ignored in <code>SourceNode</code>s.\nIssue #116.</p>\n</li>\n</ul>\n<h2>0.1.34</h2>\n<ul>\n<li>\n<p>Make <code>SourceNode</code> work with windows style ("\\r\\n") newlines. Issue #103.</p>\n</li>\n<li>\n<p>Fix bug involving source contents and the\n<code>SourceMapGenerator.prototype.applySourceMap</code>. Issue #100.</p>\n</li>\n</ul>\n<h2>0.1.33</h2>\n<ul>\n<li>\n<p>Fix some edge cases surrounding path joining and URL resolution.</p>\n</li>\n<li>\n<p>Add a third parameter for relative path to\n<code>SourceMapGenerator.prototype.applySourceMap</code>.</p>\n</li>\n<li>\n<p>Fix issues with mappings and EOLs.</p>\n</li>\n</ul>\n<h2>0.1.32</h2>\n<ul>\n<li>\n<p>Fixed a bug where SourceMapConsumer couldn\'t handle negative relative columns\n(issue 92).</p>\n</li>\n<li>\n<p>Fixed test runner to actually report number of failed tests as its process\nexit code.</p>\n</li>\n<li>\n<p>Fixed a typo when reporting bad mappings (issue 87).</p>\n</li>\n</ul>\n<h2>0.1.31</h2>\n<ul>\n<li>\n<p>Delay parsing the mappings in SourceMapConsumer until queried for a source\nlocation.</p>\n</li>\n<li>\n<p>Support Sass source maps (which at the time of writing deviate from the spec\nin small ways) in SourceMapConsumer.</p>\n</li>\n</ul>\n<h2>0.1.30</h2>\n<ul>\n<li>\n<p>Do not join source root with a source, when the source is a data URI.</p>\n</li>\n<li>\n<p>Extend the test runner to allow running single specific test files at a time.</p>\n</li>\n<li>\n<p>Performance improvements in <code>SourceNode.prototype.walk</code> and\n<code>SourceMapConsumer.prototype.eachMapping</code>.</p>\n</li>\n<li>\n<p>Source map browser builds will now work inside Workers.</p>\n</li>\n<li>\n<p>Better error messages when attempting to add an invalid mapping to a\n<code>SourceMapGenerator</code>.</p>\n</li>\n</ul>\n<h2>0.1.29</h2>\n<ul>\n<li>Allow duplicate entries in the <code>names</code> and <code>sources</code> arrays of source maps\n(usually from TypeScript) we are parsing. Fixes github issue 72.</li>\n</ul>\n<h2>0.1.28</h2>\n<ul>\n<li>Skip duplicate mappings when creating source maps from SourceNode; github\nissue 75.</li>\n</ul>\n<h2>0.1.27</h2>\n<ul>\n<li>Don\'t throw an error when the <code>file</code> property is missing in SourceMapConsumer,\nwe don\'t use it anyway.</li>\n</ul>\n<h2>0.1.26</h2>\n<ul>\n<li>Fix SourceNode.fromStringWithSourceMap for empty maps. Fixes github issue 70.</li>\n</ul>\n<h2>0.1.25</h2>\n<ul>\n<li>Make compatible with browserify</li>\n</ul>\n<h2>0.1.24</h2>\n<ul>\n<li>Fix issue with absolute paths and <code>file://</code> URIs. See\n<a href="https://bugzilla.mozilla.org/show_bug.cgi?id=885597">https://bugzilla.mozilla.org/show_bug.cgi?id=885597</a></li>\n</ul>\n<h2>0.1.23</h2>\n<ul>\n<li>Fix issue with absolute paths and sourcesContent, github issue 64.</li>\n</ul>\n<h2>0.1.22</h2>\n<ul>\n<li>Ignore duplicate mappings in SourceMapGenerator. Fixes github issue 21.</li>\n</ul>\n<h2>0.1.21</h2>\n<ul>\n<li>Fixed handling of sources that start with a slash so that they are relative to\nthe source root\'s host.</li>\n</ul>\n<h2>0.1.20</h2>\n<ul>\n<li>Fixed github issue #43: absolute URLs aren\'t joined with the source root\nanymore.</li>\n</ul>\n<h2>0.1.19</h2>\n<ul>\n<li>Using Travis CI to run tests.</li>\n</ul>\n<h2>0.1.18</h2>\n<ul>\n<li>Fixed a bug in the handling of sourceRoot.</li>\n</ul>\n<h2>0.1.17</h2>\n<ul>\n<li>Added SourceNode.fromStringWithSourceMap.</li>\n</ul>\n<h2>0.1.16</h2>\n<ul>\n<li>\n<p>Added missing documentation.</p>\n</li>\n<li>\n<p>Fixed the generating of empty mappings in SourceNode.</p>\n</li>\n</ul>\n<h2>0.1.15</h2>\n<ul>\n<li>Added SourceMapGenerator.applySourceMap.</li>\n</ul>\n<h2>0.1.14</h2>\n<ul>\n<li>The sourceRoot is now handled consistently.</li>\n</ul>\n<h2>0.1.13</h2>\n<ul>\n<li>Added SourceMapGenerator.fromSourceMap.</li>\n</ul>\n<h2>0.1.12</h2>\n<ul>\n<li>SourceNode now generates empty mappings too.</li>\n</ul>\n<h2>0.1.11</h2>\n<ul>\n<li>Added name support to SourceNode.</li>\n</ul>\n<h2>0.1.10</h2>\n<ul>\n<li>Added sourcesContent support to the customer and generator.</li>\n</ul>',docPath:"argo-ci/node_modules/source-map/changelog",proj:"argo-ci"}}}});
